import React from 'react';
import Login from '../components/Login';

const Home = () => {

    const [registerView, setRegister] = React.useState(null);

    <>
    <h1>Welcome to Tinder Clone</h1>

    {showRegister ? (
      <>
        <Register />
        <p>
          Already have an account?{' '}
          <span onClick={() => setShowRegister(false)} style={{ cursor: 'pointer', color: 'blue' }}>
            Login here
          </span>
        </p>
      </>
    ) : (
      <>
        <Login registerView={registerView} setRegister={setRegister}/>
        
      </>
    )}
  </>
};

export default Home;
